import React from 'react';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { compose } from 'redux';

import { SelectionCollectionsLoaded } from '../../redux/shop/shop.selector.js';
import WithSpinner from '../spinner/spinner.components.jsx';
import CollectionOverview from './collections-overview.component.jsx';

const mapStateToProps = createStructuredSelector({
    isLoading: SelectionCollectionsLoaded
})

const CollectionsOverviewContainer = compose(
    connect(mapStateToProps),
    WithSpinner
)(CollectionOverview)
